INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3505700000031', 'Ficelle Picarde 2 crêpes Jambon, Emmental & Champignons', 'Garniture 74% : jambon cuit 19,5% (jambon de porc, eau, sel, dextrose, arômes, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium), eau, champignons 12,5% (champignons, eau, sel, acidifiant : acide citrique, antioxydant : acide ascorbique), crème fraîche 9% (_lait_), emmental 5,5% (_lait_), cordon de sauce 4,5% (eau, amidon modifié, lactosérum en poudre (_lait_), matière grasse végétale, _lait_ écrémé en poudre, maltodextrine, farine de blé (_gluten_), sirop de glucose, gélifiants : E450, E415, E401, E404, E339, E341 : sel, protéines de _lait, stabilisant : E451, arômes, _lait_ écrémé en poudre, farine de blé (_gluten_), jaune d\'_œufs_, amidon modifié, sel, poivre, muscade, arômes (_lait_). Crêpe 26% : eau, farine de blé (_gluten_), jaune d’œufs_, _lait_ écrémé en poudre, dextrose.', 'https://static.openfoodfacts.org/images/products/350/570/000/0031/front_fr.4.400.jpg', '6.9', '3.8', '16.1', '4.4', '', '9.4', '1.02', '0.401574803149606', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3505700001151', 'Salade poulet crudités, sauce caesar', 'Salade composée 86% : salade 42% (iceberg, frisée, trévise), poulet rôti 18,5% (poulet, huile de tournesol ; acidifiants : E326, E261, sel ; stabilisants : E407a, E451i ; dextrose de blé, amidon de pomme de terre, sucre brun, antioxydant : E301), carottes 16%, maïs sans OGM 16%, tomate cerise 7%. Sauce Caesar 14% : eau, huile de colza, crème fraîche, fromage blanc, fromage, moutarde de Dijon (eau, graines de moutarde, vinaigre d\'alcool, sel, acidifiant : acide citrique), vinaigre d\'alcool, sel, sucre, amidon transformé, arôme, poivre blanc, ail, épaississant : gomme xanthane.', 'https://static.openfoodfacts.org/images/products/350/570/000/1151/front_fr.6.400.jpg', '5', '1', '5', '1.8', '1.3', '5', '0.4064', '0.16', '', '1');

