VALUES ('3505700001250', 'Salade Jambon Emmental ', 'Salade composée 86% : Salade 42% (Iceberg, frisée, trévise), oeuf, carottes 13%, jambon cuit fumé 11.5% (Jambon de porc, eau, sel, sirop de glucose, Stabilisants : E451, E450, Arôme naturel et arôme de fumée, Conservateurs : E316, E250), emmental 9.5%, tomate cerise 3%. Vinaigrette allégée aux herbes 14% : Eau, huile de colza 35%, moutarde de Dijon (Eau, graines de moutarde, vinaigre d\'alcool, sel, Acidifiant : Acide citrique), sucre, vinaigre d\'alcool, vinaigre de vin rouge, persil 3%, ciboulette 2.4%, sel, amidon transformé, poivre blanc, Epaississant : Gomme xanthane', 'https://static.openfoodfacts.org/images/products/350/570/000/1250/front_fr.6.400.jpg', '9.5', '2.6', '3', '2.2', '0.9', '6', '0.5588', '0.22', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
